package day5;

public class Day5 {

    public static void main(String[] ags) {

        // part 1
        String testOut = simplify(testInput);
        System.out.println(testOut);
        System.out.println(testOut.length());

        String out = simplify(input);
        System.out.println(out.length());

        // part 2

        // What is the length of the shortest polymer you can produce by removing all units of exactly one type and fully reacting the result?

        findMinAfterRemoval(testInput);
        findMinAfterRemoval(input);
    }

    private static void findMinAfterRemoval(String input) {
        int minLength = Integer.MAX_VALUE;
        char minLengthLetter = '\0';

        for (char removed = 'a'; removed <= 'z'; removed++) {
            String inRemoved = input
                    .replace(removed + "", "")
                    .replace(Character.toUpperCase(removed) + "", "");

            String simplified = simplify(inRemoved);
            if (simplified.length() <= minLength) {
                minLength = simplified.length();
                minLengthLetter = removed;
            }
        }

        System.out.println("findMinAfterRemoval");
        System.out.println(minLength);
        System.out.println(minLengthLetter);
    }

    private static String simplify(String in) {
        StringBuilder acc = new StringBuilder();

        char lastCharInv = '\0';

        for (int inIdx = 0; inIdx < in.length(); inIdx++) {
            char next = in.charAt(inIdx);
            if (next == lastCharInv) {
                // reaction:
                acc.deleteCharAt(acc.length() - 1);
            } else {
                acc.append(next);
            }
            if (acc.length() == 0) {
                lastCharInv = '\0';
            } else {
                lastCharInv = invertChar(acc.charAt(acc.length() - 1));
            }
        }

        return acc.toString();
    }

    private static char invertChar(char c) {
        if (Character.isLowerCase(c)) {
            return Character.toUpperCase(c);
        }
        return Character.toLowerCase(c);
    }

    static String testInput = "dabAcCaCBAcCcaDA";

    static String input = "";
}
